import React, {Component} from 'react';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = {
      repos: [],
      isLoaded: false,
      error: null
    };
  }

   componentDidMount() {
    fetch('https://api.github.com/users/calebdsharp/repos')
    .then(
      (result) => {
      this.setState({
        isLoaded: true,
        repos: result
      });
      console.log(this.state.repos);
    },
    (error)=> {
      this.setState({
        isLoaded: true,
        error
      });
    }
  )}

  render() {
    return (
      <></>
    );
    }
}
export default Projects;
